import Home from "./pages/Home";
import MatchEngine from "./pages/MatchEngine";

function App() {
  const [currentPage, setCurrentPage] = React.useState("home");
  return (
    <>
      {currentPage === "home" && <Home />}
      {currentPage === "find" && <MatchEngine />}
    </>
  );
}

export default App;
